  const [activeItem, setActiveItem] = useState('inicial');

  function handleItemClick(page: string) {
    alert(page);
    setActiveItem(page);
  }

  return (
    <>
      <Head>
        <title>Prazer, Cuby!</title>
        <Meta />
      </Head>
      <HTML>
        <h1>Hello, Header!</h1>
        <Container>
            <img src="/assets/images/logo_header.svg" onClick={() => handleItemClick('inicio')} />
            <MenuWeb>

            </MenuWeb>
            <MenuMobile>

            </MenuMobile>
        </Container>
      </HTML> 
    </>
  );
}

export default Header;
